import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import './style/App.css'
import StreamCreate from './components/streams/StreamCreate'
import StreamList from './components/streams/StreamList'
import StreamShow from './components/streams/StreamShow'
import StreamEdit from './components/streams/StreamEdit'
import StreamDelete from './components/streams/StreamDelete'

class App extends React.Component {


  render() {

    return(
      <div className="ui container">
          <BrowserRouter>
          <div>
          <Route path='/' exact component={StreamCreate}/>
          <Route path='/list' exact component={StreamList}/>
          <Route path='/Delete' exact component={StreamDelete}/>
          <Route path='/show' exact component={StreamShow}/>
          <Route path='/edit' exact component={StreamEdit}/>
          </div>
          </BrowserRouter>
        </div>

    )

}
}




export default App;
